progName = "Cadastraitor"


def hasOnlyNumbers(string):
	hasOnlyNumbers = True
	for char in string :
		if not char.isdigit() :
			hasOnlyNumbers = False
			
	if hasOnlyNumbers and string != "":
		return True
	return False

def hasOnlyWhiteSpaces(string):

	found = False

	for char in string:
		if not (char.isspace() or char == '\n' or char == '\t') :
			found = True
			break
	return not found


class App :

	def loadData(self):
	
		global dryRun
		global progName
	
		config = cp.ConfigParser()
		
		try:
			config.read("config.ini")
			user = config.get("data", "login")
			sei = config.get("data", "SEI")
			progName = config.get("program", "name")
			self.showMessage = config.get("program", "showmessage")
			rememberPass = config.get("program", "rememberpass")
			cryptoPassword = config.get("data", "senha")			
			dryRunStr = config.get("program", "dryrun")
		except:
			tkmb.Message(self.root, message="Problema com o arquivo INI.\nTerminando execução.", type=tkmb.OK, icon=tkmb.ERROR, title="ERRO DE CONFIGURAÇÃO").show()		
			quit()
			return None
	
		self.SEI.set(sei)
		self.user.set(user)
		
		if dryRunStr == "0":
			dryRun = False
		else:
			dryRun = True
		
		if rememberPass == "1":
			self.rememberVar.set(True)
		else:
			self.rememberVar.set(False)
	
		wr = WinRegistry()
		cryptoKey = ""
		password = ""
		try:
			cryptoKey = wr.getKey("cryptoKey")
			self.cipher = Fernet(cryptoKey)
			print("cryptoPassword: ", cryptoPassword[2:-1])
			password = self.cipher.decrypt(cryptoPassword[2:-1])
		except:
			newKey = Fernet.generate_key()
			self.cipher = Fernet(newKey)
			wr.setKey("cryptoKey", newKey)
			password = b""
			print("generating new key")

		self.passw.set(password.decode())

	def saveData(self):
		
		config = cp.ConfigParser()
		config.read("data.ini")
		
		dryRunStr = ""
		if not dryRun :
			dryRunStr = "0"
		else:
			dryRunStr = "1"
		
		rememberPass = ""
		password = ""
		if self.rememberVar.get() :
			rememberPass = "1"
			password = self.passw.get()
		else:
			rememberPass = "0"
			password = ""

		cryptoPassword = self.cipher.encrypt(password.encode())

		config["program"] = { "name" : progName, "showmessage" : self.showMessage, "dryrun": dryRunStr, "rememberpass" : rememberPass }
		config["data"] = { "login": self.user.get(), "SEI" : self.SEI.get(), "senha" : cryptoPassword}

		file = open("config.ini", "w")
		config.write(file)

	def message(self, text):
		tkmb.Message(self.root, message=text, type=tkmb.OK, icon=tkmb.WARNING).show()

	def erasePNGfiles(self):
		
		for file in os.listdir() : 
			if file.endswith('.png') and file != "noface.png" and file != "alien.png" :
				print("deleting " + file)
				os.remove(file)

	def showImage(self):
		try:
			im = Image.open(self.usuarios[self.i].RA.get() + ".png")
			im.show()
		except:
			print("failure to open image")
	
	def beep(self, freq=500, duration=100):
		winsound.Beep(freq, duration)
	
	def getAuth(self):
		
		class AuthData:
			def __init__(self):
				self.username = None
				self.password = None
		
		auth = AuthData()
		auth.username = self.user.get()
		auth.password = self.passw.get()
		return auth
	
	def loadNotes(self):
		
		try:
			file = open("notas.txt", "r")
			notes = file.read()
			file.close()
			
			notes = notes[:-1]
			self.notasText.insert("1.0", notes)
		except:
			pass
		
	def saveNotes(self):
		file = open("notas.txt", "w")
		file.write( self.notasText.get("1.0", "end") )
		file.close()
	
	def saveSEI(self):
		file = open("sei.data", "w")
		file.write(self.SEI.get())
		file.close()
	
	def loadSEI(self):
		try:
			file = open("sei.data", "r")
			self.SEI.set(file.read())
			file.close()
		except:
			pass
	
	def loadUserAndPass(self):
		
		try:
		
			file = open("user.data")
			userToken = file.readline()
			passwToken = file.readline()
			file.close()
			
			key = b"70F3T4GCnMSIfkA3aSydw28BIzSDO9YUXs30Wc0-034="
			fernet = Fernet(key)
			unUserToken = fernet.decrypt(userToken)
			unPasswToken = fernet.decrypt(passwToken)
			
			self.user.set(unUserToken.decode("utf-8"))
			self.passw.set(unPasswToken.decode("utf-8"))
			
		except:
			pass
		
	def saveUserAndPass(self):
			
		file = open("user.data", "w")
		file.write(userToken.decode("utf-8"))
		file.write("\n")
		file.write(passwToken.decode("utf-8"))
		file.close()
	
	def addRAfromEntry(self, string=""):
		
		if not hasOnlyWhiteSpaces(self.ra.get()) :
			self.userListBox.insert("end", self.ra.get())
			self.userListBox.see(self.userListBox.size()-1)
			self.ra.set("")
			self.raEntry.focus_set()
		else:
			tkmb.Message(self.root, message="Campo RA vazio.", title="ERRO", type=tkmb.OK, icon=tkmb.ERROR).show()
	
	def addRA(self, string=""):
	
		if not hasOnlyWhiteSpaces(string) :
			self.userListBox.insert("end", string)
			self.userListBox.see(self.userListBox.size()-1)			
		else:
			tkmb.Message(self.root, message="Campo RA vazio.", title="ERRO", type=tkmb.OK, icon=tkmb.ERROR).show()
		
	def subtractRA(self, string=""):
	
		selected = self.userListBox.curselection()
		if(len(selected) > 0):
			self.userListBox.delete(selected[0])
			
	def loadPrev(self):
		self.i = self.i - 1
		if self.i < 0:
			self.i = len(self.usuarios)-1
			self.beep()
			
		self.loadUsuarioAtVerificacao(self.usuarios, self.i)
		
	def loadNext(self):
		self.i = self.i + 1
		if self.i >= len(self.usuarios):
			self.i = 0
			self.beep()
		self.loadUsuarioAtVerificacao(self.usuarios, self.i)
	
	def getFromClipboard(self):
		
		try:
			longStr = self.root.clipboard_get()
			
			splitted = longStr.split("\n")
			
			for ra in splitted :
				self.addRA(ra)
		except:
			print("clipboard failure")

	def report(self):
		for usuario in self.usuarios:
			self.relatorioText.insert("end", str(usuario))

