	def process(self):
	
		answer = tkmb.Message(self.root, message="Tem certeza que deseja iniciar o processo?", type=tkmb.YESNO, icon=tkmb.QUESTION).show()
		
		# possibilidades para aluno.status
		# DESCONHECIDO <- houve algum erro, não faça nada!
		# INEXISTENTE <- não faça nada!
		# INFO COLETADA <- faça o cadastro normalmente.
		# ATIVO <- não faça nada!
		# INATIVO <- ative
			# clicar em "Reativar Usuário Externo" e depois em "OK"
		# ATIVO E PENDENTE <- ative
			# clique em "Alterar Usuário Externo", depois no checkbutton "Liberado", depois no botão "Salvar"
		# INATIVO E PENDENTE
			# clicar em "Reativar Usuário Externo", depois em "OK", daí então
			# clique em "Alterar Usuário Externo", depois no checkbutton "Liberado", depois no botão "Salvar"
		
		if answer == tkmb.YES :
			
			if self.bot is None:
				self.bot = Robot()
				self.bot.root = self.root
				self.bot.getAuth = self.getAuth
					
			self.bot.processarCadastros(self.usuarios, self.SEI.get(), self.passw.get())
			self.report()
			
			tkmb.Message(self.root, message="Processo completado!", type=tkmb.OK, icon=tkmb.INFO).show()
	
	def collect(self):
		
		if self.SEI.get() == "" :
			tkmb.Message(self.root, message="Processo SEI não especificado.", type=tkmb.OK, icon=tkmb.WARNING).show()
			return None
		
		listaCods = self.userListBox.get(0, "end")
	
		if len(listaCods) == 0:
			tkmb.Message(self.root, message="Lista vazia, nada a coletar.", type=tkmb.OK, icon=tkmb.WARNING).show()
			return None
		
		# initializing PROCESSAMENTO...
		self.i = 0
		self.usuarios.clear()
		self.relatorioText.delete('1.0', "end")	
		self.coletarButton.config(text="COLETANDO...")
		self.notebook.tab(2, state="disabled")
		self.root.update()
		self.erasePNGfiles()
		
		if self.bot is None:
			self.bot = Robot()
			self.bot.root = self.root
			self.bot.getAuth = self.getAuth
		
		self.usuarios = self.bot.getStatusUsuarios(listaCods)
		
		self.bot.logInSEI()
		
		# a ordem dessas duas linhas abaixo importa, não mexa!
		self.bot.getInativos(self.usuarios)
		self.bot.getAtivos(self.usuarios)
		
		# returning to normal execution, avaliate if PROCESSAR button makes sense
		self.coletarButton.config(text="COLETAR DADOS")
		self.report()
		
		for usuario in self.usuarios:
			if usuario.hasPic:
				usuario.facePic = ImageTk.PhotoImage(Image.open(usuario.RA.get() + "face.png"))
			elif usuario.externo:
				usuario.facePic = self.alienFace
		
		
		self.loadUsuarioAtVerificacao(self.usuarios, self.i)
		self.notebook.tab(2, state="normal")
		
		tkmb.Message(self.root, message="Informações Coletadas!", type=tkmb.OK, icon=tkmb.INFO).show()

	def loadUsuarioAtVerificacao(self, usuarios, index):

		try :

			usuario = usuarios[index]

			self.nomeEntry.config(textvariable=usuario.nome)
			self.nomeSocialEntry.config(textvariable=usuario.nomeSocial)
			self.CPFEntry.config(textvariable=usuario.CPF)
			self.RGEntry.config(textvariable=usuario.RG)
			self.orgaoExpedidorEntry.config(textvariable=usuario.SSP)
			self.telefoneComercialEntry.config(textvariable=usuario.telefoneComercial)
			self.telefoneCelularEntry.config(textvariable=usuario.telefoneCelular)
			self.telefoneResidencialEntry.config(textvariable=usuario.telefoneResidencial)
			self.enderecoEntry.config(textvariable=usuario.endereco)
			self.complementoEntry.config(textvariable=usuario.complemento)
			self.bairroEntry.config(textvariable=usuario.bairro)
			self.paisEntry.config(textvariable=usuario.pais)
			self.estadoEntry.config(textvariable=usuario.UF)
			self.cidadeEntry.config(textvariable=usuario.cidade)
			self.CEPEntry.config(textvariable=usuario.CEP)
			self.emailEntry.config(textvariable=usuario.email)
			self.estrangeiroCheck.config(variable=usuario.estrangeiro)
			self.gerarTermoCheck.config(variable=usuario.gerarTermo)
			
			if usuario.hasPic or usuario.externo :
				self.photoLabel.config(image=usuario.facePic)
			else:
				self.photoLabel.config(image=self.noFace)
			
			if usuario.externo:
				self.gerarTermoCheck.config(state = "disabled")
			else:
				self.gerarTermoCheck.config(state = "enabled")
			
			string = str(index+1) + "/" + str(len(usuarios))
			self.positionLabel.config(text=string)
			
			self.cadastrarCheck.config(variable=usuario.cadastrar)
			
			if usuario.status == "INEXISTENTE" or (usuario.status == "DESCONHECIDO" and not usuario.externo) or usuario.status == "ATIVO":
				self.cadastrarCheck.config(state = "disabled")
			else:
				self.cadastrarCheck.config(state = "enabled")
			
			self.RALabel.config(text="RA: " + usuario.RA.get())
			self.StatusLabel.config(text="STATUS: " + usuario.status)
			
		except:
			print("index out of range")
	
	def onStartup(self):
		self.loadData()
		self.loadNotes()
		self.root.title(progName)
	
	def onExit(self):
		
		self.saveNotes()
		self.saveData()
		self.erasePNGfiles()
	
		self.root.destroy()
		print("finished!")

