	def preencheUsuarioExterno(self):
	
		# limpa tudo!
		self.usuarios[self.i].RG.set("")
		self.usuarios[self.i].CPF.set("")
		self.usuarios[self.i].nomeSocial.set("")
		self.usuarios[self.i].nome.set("")
		self.usuarios[self.i].SSP.set("")
		self.usuarios[self.i].telefoneResidencial.set("")
		self.usuarios[self.i].telefoneCelular.set("")
		self.usuarios[self.i].endereco.set("")
		self.usuarios[self.i].complemento.set("")
		self.usuarios[self.i].bairro.set("")
		self.usuarios[self.i].UF.set("")
		self.usuarios[self.i].cidade.set("")
		self.usuarios[self.i].CEP.set("")
		self.usuarios[self.i].email.set("")
		self.usuarios[self.i].pais.set("")

		clipboard = self.root.clipboard_get().replace('\u2002', ' ').replace("\n", " ")
	
		segments = clipboard.split(":")
		
		print("==========================")
		print("==========================")
		for (number,segment) in enumerate(segments):
			print(number, ":", segment.strip() , "---")
		print("==========================")
		print("==========================")
			
		i = 0

		while i < len(segments) :

			token = segments[i].strip()
			
			nextToken = "ERRO"
			if i+1 < len(segments):
				nextToken = segments[i+1].strip()
			
			if "Nome Completo do Usuário" in token :
				self.usuarios[self.i].nome.set(" ".join(nextToken.split(" ")[:-2]))
			elif "Nome Social" in token:
				self.usuarios[self.i].nomeSocial.set(" ".join(nextToken.split(" ")[:-1]))
			elif "CPF" in token:
				self.usuarios[self.i].CPF.set(" ".join(nextToken.split(" ")[:-1]))
			elif "RG" in token:
				self.usuarios[self.i].RG.set(" ".join(nextToken.split(" ")[:-2]))
			elif "Expedidor" in token:
				self.usuarios[self.i].SSP.set(" ".join(nextToken.split(" ")[:-4]))
			elif "Telefone Fixo" in token:
				self.usuarios[self.i].telefoneResidencial.set(" ".join(nextToken.split(" ")[:-2]))
			elif "Telefone celular" in token:
				self.usuarios[self.i].telefoneCelular.set(" ".join(nextToken.split(" ")[:-2]))
			elif "Endereço Residencial" in token:
				self.usuarios[self.i].endereco.set(" ".join(nextToken.split(" ")[:-1]))
			elif "Complemento" in token:
				self.usuarios[self.i].complemento.set(" ".join(nextToken.split(" ")[:-1]))
			elif "Bairro" in token:
				self.usuarios[self.i].bairro.set(" ".join(nextToken.split(" ")[:-1]))
			elif "Estado" in token:
				self.usuarios[self.i].UF.set(" ".join(nextToken.split(" ")[:-1]))
			elif "Cidade" in token:
				self.usuarios[self.i].cidade.set(" ".join(nextToken.split(" ")[:-1]))
			elif "CEP" in token:
				self.usuarios[self.i].CEP.set(" ".join(nextToken.split(" ")[:-2]))
			elif "E-mail" in token:
				self.usuarios[self.i].email.set(" ".join(nextToken.split(" ")))
			
			self.usuarios[self.i].pais.set("Brasil")
			
			i += 1

